DROP TABLE IF EXISTS `zl_region`;
CREATE TABLE `zl_region` (
  `id` mediumint(7) unsigned NOT NULL,
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '城市名字',
  `parent_id` mediumint(7) unsigned NOT NULL DEFAULT '0' COMMENT '上一级城市的id',
  `level` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1省2市3区',
  `pinyin` varchar(50) NOT NULL DEFAULT '' COMMENT '城市的拼音',
  `approver1_admin_id` int(11) NOT NULL DEFAULT '0' COMMENT '一级审批人后台管理员id（省为一级市委为2级）',
  `approver1_admin_phone` char(11) NOT NULL DEFAULT '' COMMENT '一级审批人手机号',
  `approver2_admin_id` int(11) NOT NULL DEFAULT '0' COMMENT '二级审批人后台管理员id（省为一级市委为2级）',
  `approver2_admin_phone` char(11) NOT NULL DEFAULT '' COMMENT '二级审批人手机号',
  `open` tinyint(4) NOT NULL DEFAULT '2' COMMENT '是否开通：1开通2没开通',
  `ctime` int(11) NOT NULL DEFAULT '0' COMMENT '开通时间',
  PRIMARY KEY (`id`),
  KEY `name` (`name`),
  KEY `pid` (`parent_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='省市区坐标';

